    string GetSizeString(long size)
    {
        int ext = 0;
        long Size = size;
        string Suffix = "";
        while (Size > 1024)
        {
            ext++;
            Size /= 1024;
        }
        switch (ext)
        {
            case 0:
                Suffix = "bytes";
                break;
            case 1:
                Suffix = "KB";
                break;
            case 2:
                Suffix = "MB";
                break;
            case 3:
                Suffix = "GB";
                break;
            case 4:
                Suffix = "TB";
                break;
        }
        return $"{Size} {Suffix}";
    }

